import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


export const Vehicles = () =>
{
    return (
        <main>
        <Container className="lg">
            <Row>
                <Col>1 of 3</Col>
                <Col xs={5}>2 of 3 (wider)</Col>
                <Col>3 of 3</Col>
            </Row>
        </Container>
        </main>
    )
}

export default Vehicles;
